import React from 'react'
import styled from 'styled-components'

const StyledCard = styled.div`
  background-color: hotpink;
  height: 250px;
  width: 100px;
  margin: 0 1rem;
`

const Card = (props) => {
  return (
    <StyledCard>
      <div className="card-container">
        <div className="card-title">
          { props.title }
        </div>
      </div>
    </StyledCard>
  )
}

export default Card
